import Slider from "../component/Slider";


const Home = ()=>{
    return(
            <>
            <Slider/>
   <br/>
   <h1 className=" container text-center">Trending Products</h1>
   <br/>
   <div className="contain">
    <Carde imgsrc="https://m.media-amazon.com/images/I/71jG+e7roXL._AC_UL480_QL65_.jpg" title="Apple Mac Book Pro" description="this is new apple product" path="/productview"/>
